
struct Solution;

impl Solution {
    pub fn maximum_happiness_sum(mut happiness: Vec<i32>, k: i32) -> i64 {
        happiness.sort_by(|a, b| b.cmp(a));
        // println!("{:?}", happiness);
        let mut sum: i64 = 0;
        for (idx, hp) in happiness.iter().enumerate() {
            if idx as i32 >= k || idx as i32 >= *hp {
                break
            }
            sum += (*hp - idx as i32) as i64;
        }
        sum
    }
}

struct Solution1;

impl Solution1 {
    pub fn maximum_happiness_sum(mut happiness: Vec<i32>, k: i32) -> i64 {
        let n = happiness.len();
        let k = k as usize;
        let top_k = if k + 1 < happiness.len() {
            happiness.select_nth_unstable(n - k - 1).2
        } else {
            happiness.as_mut_slice()
        };
        top_k.sort_unstable();

        (0..).zip(top_k.iter().copied().rev())
            .take_while(|&(penalty, unpenalized)| penalty < unpenalized)
            .take(k as usize)
            .map(|(penalty, unpenalized)| (unpenalized - penalty) as i64)
            .sum()
    }
}

struct Solution2;

impl Solution2 {
    pub fn maximum_happiness_sum(mut happiness: Vec<i32>, k: i32) -> i64 {
        let n = happiness.len();
        let top_k = if k + 1 < n as i32 {
            happiness.select_nth_unstable(n - k as usize - 1).2
        } else {
            happiness.sort();
            happiness.as_mut_slice()
        };
        let mut sum = 0;
        for (idx, hp) in top_k.iter().rev().enumerate() {
            if idx as i32 >= k || idx as i32 >= *hp  {
                break;
            }
            sum += (*hp - idx as i32) as i64;
        }
        sum
    }
}

